import json

def create_json_object(name, age, occupation, street, city, country, hobbies, education):
    """"""
    details = {'name': name, 'age': age, 'occupation': occupation, 'address': {'street': street, 'city': city, 'country': country}, 'hobbies': hobbies, 'education': education}
    return json.dumps(details, indent=4)
